class Tokenizer:

    def __init__(self):
        # Initialisation des dictionnaires pour la correspondance entre caractères et tokens.
        self.dictionary = {}           # Dictionnaire pour associer chaque caractère à un nombre (token)
        self.reverse_dictionary = {}   # Dictionnaire inverse pour retrouver le caractère à partir du token

        # Ajout du token de remplissage (padding) dans le dictionnaire.
        self.__add_to_dict('<pad>')

        # Ajout des chiffres (0 à 9) au dictionnaire.
        for i in range(10):
            self.__add_to_dict(str(i))

        # Ajout des lettres minuscules (a à z) au dictionnaire.
        for i in range(26):
            self.__add_to_dict(chr(ord('a') + i))

        # Ajout d’un point et d’un espace pour gérer la ponctuation et les espaces.
        self.__add_to_dict('.')
        self.__add_to_dict(' ')

    def __add_to_dict(self, character):
        """
        Méthode privée pour ajouter un caractère au dictionnaire.
        Si le caractère n'est pas déjà présent, il est associé à un numéro qui correspond à la taille actuelle du dictionnaire.
        Le dictionnaire inverse est également mis à jour pour permettre la conversion inverse.
        """
        if character not in self.dictionary:
            # Associe le caractère à un token (nombre entier)
            self.dictionary[character] = len(self.dictionary)
            # Met à jour le dictionnaire inverse pour retrouver le caractère à partir du token
            self.reverse_dictionary[self.dictionary[character]] = character

    def tokenize(self, text):
        """
        Convertit une chaîne de caractères en une liste de tokens.
        Chaque caractère de la chaîne est remplacé par son token correspondant selon le dictionnaire.
        """
        return [self.dictionary[c] for c in text]

    def character_to_token(self, character):
        """
        Retourne le token correspondant à un caractère donné.
        """
        return self.dictionary[character]

    def token_to_character(self, token):
        """
        Retourne le caractère correspondant à un token donné.
        """
        return self.reverse_dictionary[token]

    def size(self):
        """
        Retourne la taille totale du dictionnaire, c'est-à-dire le nombre total de tokens définis.
        """
        return len(self.dictionary)

